import { Container, Grid, Typography } from "@material-ui/core";
import styles from "./Header.module.scss";

function Header() {
  return (
    <div className={styles.header}>
        <Container fixed>
          <Grid container>
            <Grid item xs={6} sm={5}>
                Conteudo 1
            </Grid>
            <Grid item xs={6} sm={5}>
                Conteudo 2
            </Grid>
          </Grid>
        </Container>
    </div>
  );
}

export default Header;
